import React from "react";

export default function PostData({ postData, setPostData, setPostId }) {
  const backTofeed = () => {
    setPostId(0);
    setPostData([]);
  };
  return (
    <div>
      <h1>{postData.title}</h1>
      <button onClick={backTofeed}>baack</button>
    </div>
  );
}
